import "../token/KryptoX777V0_1_0.sol";
import "./IProxyPayment.sol";
import "../EIP777/IEIP777TokensOperator.sol";
import "../EIP820/IEIP820Implementer.sol";
import "../EIP820/EIP820Implementer.sol";
import "../EIP777/IEIP777.sol";
import "../ownership/UnstructuredOwnable.sol";


contract ProxyPaymentV0_1_0 is UnstructuredOwnable ,IEIP820Implementer, EIP820Implementer, IEIP777TokensOperator, IProxyPayment {

    using SafeMath for uint256;

    struct provider{
        address pAddress;
        uint indexLoc;
        bool isValid;
    }
    mapping(address => provider) providerValidator;
    address[] private providers;                //addresses of providers to transfer funds
    address private kryptoXaddress;
    uint256 private kryptoFee;                  // integer fee percent (divided by the "base" vaue to allow uint storage) for krypto
    uint256 private providerFee;                // total integer fee percent (divided by the "base" value to allow for uint storage) for providers
    uint256 private base = 1000; // number that kryptoFee and providerFee are divided by to convert to decimal without having to use ufixed values.
    uint256 private etherToKpxRate = 10000;     // TODO: Change this to a variable, Keeping this constant for the time
    bool internal preventTokensSender = true;
    bool internal preventTokenReceived = true;
    bool internal _initialized;
    IEIP777 public tokenContract;

    struct accountValue{
        uint256 etherValue;
        uint256 kpxValue;
    }


    mapping (address => accountValue) waitingTransfers;

    function initialize(
        address _kryptoxAddress, 
        uint256 _kryptoFee, 
        uint256 _providerFee, 
        address _eip820RegistryAddr,
        address _owner
      )  public {
        require(!_initialized);
        setOwner(_owner);
        setTokenContract(_kryptoxAddress);
        setKryptoFee(_kryptoFee);
        setProviderFee(_providerFee);
        setIntrospectionRegistry(_eip820RegistryAddr);
        setInterfaceImplementation("IProxyPayment", this);
        enableEIP777TokensOperator();
        _initialized = true;
    }

    function initialized() public view returns(bool) {
        return _initialized;
    }

  //todo only owner?
    function setTokenContract (address _tokenContract) internal {
        tokenContract = IEIP777(_tokenContract);
    }

    function enableEIP777TokensOperator() public {
        preventTokensSender = false;
        setInterfaceImplementation("IEIP777TokensOperator", this);
    }

    function canImplementInterfaceForAddress(address addr, bytes32 interfaceHash) public view returns(bytes32) {
        return EIP820_ACCEPT_MAGIC;
    }

  /// @dev erc820 introspection : handler invoked when this contract
  ///  is made an operator for an erc777 token
    function madeOperatorForTokens(
        address operator,  
        address from,
        address to,
        uint256 amount,
        bytes userData,
        bytes operatorData
      ) public {
        //todo fix this (needed)
        // if (preventTokenOperator) { 
        //     revert();
        // }
        //tokenContract.send(to, amount, userData);
    }

    function proxySend(
        address from,
        address to,
        uint256 amount,
        bytes userData
      ) public {
        // if (preventTokenOperator) { 
        //     revert();
        // }
        //todo remove hardocded data param
        forwardPayment(from, to, "KryptoX777", amount, userData);
    }


    function getTotalUnfinishedTransferBalance() public view returns(uint,uint) {
        return (waitingTransfers[msg.sender].etherValue, waitingTransfers[msg.sender].kpxValue);
    }


    function getTotalUnfinishedTransferBalanceOfUser(address userAddress) public view onlyOwner returns(uint,uint) {
        return (waitingTransfers[userAddress].etherValue, waitingTransfers[userAddress].kpxValue);
    }

    function forwardPayment(
        address from, 
        address _recipient, 
        string _tokenType, 
        uint256 _transferAmount, 
        bytes userData
      ) public payable returns(bool) { // need to add and impliment a field for users to specify how much they want to transfer

        if(_transferAmount <= 0)
            revert();

        uint256 kryptoFeeAmount;
        uint256 providerFeeAmount;
        uint256 recieverReducedAmount;
        uint256 providerFeeLeft;
        waitingTransfers[msg.sender].etherValue = waitingTransfers[msg.sender].etherValue + msg.value;
        if (keccak256(_tokenType) == keccak256("ether")) {
            require(waitingTransfers[msg.sender].etherValue >= _transferAmount); //TODO: this part will eventually have to be replaced incase a forward payment is called a second time after sending the appropriate amount of tokens


            kryptoFeeAmount = _transferAmount * kryptoFee / base;
            providerFeeAmount = _transferAmount * providerFee / base;

            providerFeeLeft = sendProviderFee(providerFeeAmount, _tokenType);
            if (providerFeeLeft < providerFeeAmount) {
                recieverReducedAmount = _transferAmount - kryptoFeeAmount - providerFeeAmount + providerFeeLeft; //TODO: Discuss if this is a valid usecase
          } else {
                return false;        //TODO: create an event about transaction failure
          }
            _recipient.transfer(recieverReducedAmount);
            waitingTransfers[msg.sender].etherValue = waitingTransfers[msg.sender].etherValue - recieverReducedAmount;

            this.owner().transfer(kryptoFeeAmount);
            waitingTransfers[msg.sender].etherValue = waitingTransfers[msg.sender].etherValue - kryptoFeeAmount;


          //TODO: create an event of transaction complete
            return true;
        }
        else if (keccak256(_tokenType) == keccak256("KryptoX777")) {
            //require(waitingTransfers[msg.sender].kpxValue >= _transferAmount);
            kryptoFeeAmount = _transferAmount * kryptoFee / base;
            providerFeeAmount = _transferAmount * providerFee / base;
            // uint256 totalFee = kryptoFeeAmount + providerFeeAmount;
            // uint256 feeInKpx = calculateKpxFee(totalFee);
            //KryptoX777 kryptox777 = KryptoX777(kryptoXaddress);
            // if(kryptox777.balanceOf(msg.sender) < _transferAmount + totalFee){     // Discuss: The idea is that fee is reduced above the actual payment, similar to ether transactions
            //     throw;
            // }
            //providerFeeLeft = sendProviderFee(providerFeeAmount, _tokenType);

            // if (providerFeeLeft < providerFeeAmount) {
            //     recieverReducedAmount = _transferAmount - kryptoFeeAmount - providerFeeAmount + providerFeeLeft; //TODO: Discuss if this is a valid usecase
            // } else {
            //     //return false;        //TODO: create an event about transaction failure
            // }
            //todo this is a temporary workaround make it work for multiple users
            recieverReducedAmount = _transferAmount - kryptoFeeAmount - providerFeeAmount + providerFeeLeft;
            tokenContract.operatorSend(
              from, 
              _recipient, 
              recieverReducedAmount, 
              userData,
              "0x0"
            );
            waitingTransfers[msg.sender].kpxValue = waitingTransfers[msg.sender].kpxValue - recieverReducedAmount;
            tokenContract.operatorSend(
              from, 
              this.owner(), 
              kryptoFeeAmount, 
              userData,
              "0x0"
            );
            waitingTransfers[msg.sender].kpxValue = waitingTransfers[msg.sender].kpxValue - kryptoFeeAmount;
            //TODO: create an event of transaction complete
            return true;
            // uint256 kryptoAllowed = kryptox777.allowance(msg.sender, kryptoXaddress);
            // if (kryptoAllowed >= feeInKpx) {
            //     bool recievedKpx = kryptox777.transferFrom(msg.sender, this, feeInKpx);
            //     if (recievedKpx == true) {
            //         bool sendStatus = sendProviderFee(calculateKpxFee(providerFeeAmount), "kryptoX");
            //         kryptox777.transferFrom(this, kryptoXaddress, calculateKpxFee(kryptoFeeAmount));
            //         _recipient.transfer(msg.value);
            //         return true;
            //     } else {
            //         return false;
            //     }
            //} /*else {
            //   throw;
            //}*/
            // TODO: ^^^ Need to add a fail case: msg.value needs to be mapped to an address so that way if tokens are sent in a new transaction,
            //we can still send the original money that was given to the contract
        }


    }

    function calculateKpxFee(uint _totalFeeAmount) private view returns (uint256) {
        return (_totalFeeAmount * etherToKpxRate);
    }


    function sendProviderFee(uint256 _providerFeeAmount, string _type) private returns(uint256) {
        uint256 remainingProviderFee = _providerFeeAmount;
        uint256 numberOfProviders = providers.length;
        uint256 perProviderFee;
        uint j;
        perProviderFee = _providerFeeAmount / numberOfProviders;

        if (keccak256(_type) == keccak256("ether")) {
            for (j = 0; j < providers.length; j++) {
                providers[j].transfer(perProviderFee); // transfer the providers the fee if the address is not zero.
                remainingProviderFee = remainingProviderFee - perProviderFee;
                waitingTransfers[msg.sender].etherValue = waitingTransfers[msg.sender].etherValue - perProviderFee;
            }
        } 

        else if (keccak256(_type) == keccak256("kryptox777")) {
            KryptoX777V0_1_0 kryptox777 = KryptoX777V0_1_0(kryptoXaddress);

            for (j = 0; j < providers.length; j++) {
                kryptox777.transfer(providers[j], perProviderFee);
                remainingProviderFee = remainingProviderFee - perProviderFee;
                waitingTransfers[msg.sender].kpxValue = waitingTransfers[msg.sender].kpxValue - perProviderFee;
            }
        }

        return remainingProviderFee;
    }

    function addProvider(address _newProvider) public onlyOwner {
        require(_newProvider!=address(0) && !isValidProvider(_newProvider));
        providerValidator[_newProvider].pAddress = _newProvider;
        providerValidator[_newProvider].indexLoc = providers.push(_newProvider) - 1;
        providerValidator[_newProvider].isValid = true;
    }

    function isValidProvider(address _newProvider) view public returns(bool indeed){
        return providerValidator[_newProvider].isValid;  
    }

    function removeProvider(address _oldProvider) public onlyOwner {
        require(_oldProvider!=address(0) && isValidProvider(_oldProvider));
        providerValidator[_oldProvider].isValid = false;
        uint currIndexLoc = providerValidator[_oldProvider].indexLoc;
        address newProvAddress = providers[providers.length-1];
        providers[currIndexLoc] = newProvAddress;
        providerValidator[newProvAddress].indexLoc = currIndexLoc;
        providers.length --;    
    }

    function getProviderList() public view onlyOwner returns (address[100]){
        address[100] memory tempArr;
        for(uint i = 0; i < providers.length && i < 100; ++i){
            tempArr[i] = providers[i];
        }
        return tempArr;
    }

    function getProviderListLength() public view onlyOwner returns (uint){
        return providers.length;
    }



    function setKryptoFee(uint256 _kryptoFee) public onlyOwner { // function that sets the fees
        kryptoFee = _kryptoFee;
    }

    function setProviderFee(uint256 _providerFee) public onlyOwner { // function that sets the fees
        providerFee = _providerFee;
    }

    function getKryptoFee() public view returns (uint256){
        return kryptoFee;
    }

    function getProviderFee() public view returns (uint256){
        return providerFee;
    }

}
